(function() {
    function getAllURLParams() {
        const params = new URLSearchParams(window.location.search);
        let allParams = {};
        params.forEach((value, key) => {
            allParams[key] = value;
        });
        return allParams;
    }

    function setCookie(name, value, days) {
        let expires = "";
        if (days) {
            let date = new Date();
            date.setTime(date.getTime() + (days * 24 * 60 * 60 * 1000));
            expires = "; expires=" + date.toUTCString();
        }
        document.cookie = name + "=" + JSON.stringify(value) + "; path=/; domain=.finup.io" + expires;
    }

    function saveUTM() {
        const utmData = getAllURLParams();
        if (Object.keys(utmData).length === 0) return;

        if (!document.cookie.includes('utm_first')) {
            setCookie('utm_first', utmData, 30);
        }

        setCookie('utm_last', utmData, 30);
    }

    saveUTM();
})();

